import { useState } from 'react'
import { Note } from './components/note'



const App = (props) => {

  const [notes, setNotes] = useState(props.notes)

  if (!notes) {
    return 'not notes'
  }

  return (
    <div className="App">
      <h1>Class 4 bootcamp</h1>
      <ol>
        {notes.map(note =>
          <Note key={note.id} content={note.content} date={note.date} />
        )}
      </ol>
    </div>
  );
}

export default App;
